import React from 'react';

const Skills = () => {
  // Compact skills data
  const skillCategories = [
    {
      title: "Frontend",
      color: "from-blue-400 to-cyan-400",
      skills: [
        { name: "HTML5", icon: "devicon-html5-plain" },
        { name: "CSS3", icon: "devicon-css3-plain" },
        { name: "JavaScript", icon: "devicon-javascript-plain" },
        { name: "React", icon: "devicon-react-original" },
        { name: "Tailwind", icon: "devicon-tailwindcss-plain" }
      ]
    },
    {
      title: "Backend",
      color: "from-green-400 to-emerald-400",
      skills: [
        { name: "Python", icon: "devicon-python-plain" },
        { name: "Django", icon: "devicon-django-plain" },
        { name: "Node.js", icon: "devicon-nodejs-plain" },
        { name: "Java", icon: "devicon-java-plain" },
        { name: "PHP", icon: "devicon-php-plain" }
      ]
    },
    {
      title: "Database",
      color: "from-purple-400 to-pink-400",
      skills: [
        { name: "PostgreSQL", icon: "devicon-postgresql-plain" },
        { name: "MySQL", icon: "devicon-mysql-plain" },
        { name: "MongoDB", icon: "devicon-mongodb-plain" },
        { name: "Redis", icon: "devicon-redis-plain" }
      ]
    },
    {
      title: "DevOps",
      color: "from-orange-400 to-red-400",
      skills: [
        { name: "Docker", icon: "devicon-docker-plain" },
        { name: "AWS", icon: "devicon-amazonwebservices-plain" },
        { name: "Git", icon: "devicon-git-plain" },
        { name: "Linux", icon: "devicon-linux-plain" }
      ]
    }
  ];

  // Quick stats
  const quickStats = [
    { number: "95%", label: "Django/Python" },
    { number: "90%", label: "React/JS" },
    { number: "85%", label: "System Design" },
    { number: "88%", label: "Database Design" }
  ];

  return (
    <section id="skills" className="py-12 md:py-16 bg-tech-blue text-white">
      <div className="max-w-6xl mx-auto px-4 sm:px-6">
        {/* Header - Compact */}
        <div className="text-center mb-10">
          <h2 className="text-3xl md:text-4xl font-bold mb-3">
            <span className="gradient-text">Tech Stack</span>
          </h2>
          <p className="text-tech-light/70 text-sm md:text-base max-w-xl mx-auto">
            Core technologies I work with daily
          </p>
        </div>

        {/* Quick Stats Bar */}
        <div className="grid grid-cols-2 md:grid-cols-4 gap-3 mb-8 max-w-2xl mx-auto">
          {quickStats.map((stat, index) => (
            <div 
              key={index}
              className="bg-tech-navy/40 p-3 rounded-lg text-center border border-tech-cyan/10"
            >
              <div className="text-xl font-bold text-tech-cyan">{stat.number}</div>
              <div className="text-xs text-tech-light/60 mt-1">{stat.label}</div>
            </div>
          ))}
        </div>

        {/* Compact Skills Grid */}
        <div className="grid md:grid-cols-2 lg:grid-cols-4 gap-4 mb-10">
          {skillCategories.map((category, index) => (
            <div 
              key={index}
              className="bg-tech-navy/30 rounded-xl p-4 border border-tech-cyan/10 hover:border-tech-cyan/30 transition-all duration-300"
            >
              <div className="flex items-center justify-between mb-4">
                <h3 className="text-lg font-bold text-tech-light">
                  {category.title}
                </h3>
                <div className={`w-3 h-3 rounded-full bg-gradient-to-r ${category.color}`}></div>
              </div>

              <div className="space-y-3">
                {category.skills.map((skill, skillIndex) => (
                  <div 
                    key={skillIndex}
                    className="flex items-center gap-3 p-2 rounded-lg hover:bg-tech-blue/20 transition-colors"
                  >
                    <div className="w-8 h-8 flex items-center justify-center">
                      <i className={`${skill.icon} text-xl text-tech-cyan`}></i>
                    </div>
                    <span className="text-sm text-tech-light/90">{skill.name}</span>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>

        {/* Additional Skills - Scrollable */}
        <div className="mb-8">
          <h3 className="text-lg font-bold mb-4 text-tech-cyan text-center">
            More Tools & Technologies
          </h3>
          <div className="flex overflow-x-auto pb-4 space-x-3 scrollbar-hide">
            {[
              { name: "Spring Boot", icon: "devicon-spring-plain" },
              { name: "Vue.js", icon: "devicon-vuejs-plain" },
              { name: "TypeScript", icon: "devicon-typescript-plain" },
              { name: "GraphQL", icon: "devicon-graphql-plain" },
              { name: "Kubernetes", icon: "devicon-kubernetes-plain" },
              { name: "Nginx", icon: "devicon-nginx-original" },
              { name: "Jenkins", icon: "devicon-jenkins-plain" },
              { name: "Figma", icon: "devicon-figma-plain" },
              { name: "Jira", icon: "devicon-jira-plain" },
              { name: "VS Code", icon: "devicon-vscode-plain" }
            ].map((tech, index) => (
              <div 
                key={index}
                className="flex-shrink-0 flex flex-col items-center p-3 bg-tech-navy/20 rounded-lg border border-tech-cyan/5 min-w-[80px]"
              >
                <i className={`${tech.icon} text-2xl text-tech-light mb-1`}></i>
                <span className="text-xs text-tech-light/70 text-center">{tech.name}</span>
              </div>
            ))}
          </div>
        </div>

        {/* Methodology - Compact */}
        <div className="bg-tech-navy/20 rounded-xl p-6 border border-tech-cyan/10">
          <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
            <div className="text-center">
              <div className="text-2xl mb-2">üîÑ</div>
              <div className="font-bold text-tech-light text-sm">Agile</div>
              <div className="text-xs text-tech-light/60">Scrum & Kanban</div>
            </div>
            <div className="text-center">
              <div className="text-2xl mb-2">üöÄ</div>
              <div className="font-bold text-tech-light text-sm">CI/CD</div>
              <div className="text-xs text-tech-light/60">Automated</div>
            </div>
            <div className="text-center">
              <div className="text-2xl mb-2">üß™</div>
              <div className="font-bold text-tech-light text-sm">Testing</div>
              <div className="text-xs text-tech-light/60">TDD & BDD</div>
            </div>
            <div className="text-center">
              <div className="text-2xl mb-2">üõ°Ô∏è</div>
              <div className="font-bold text-tech-light text-sm">Security</div>
              <div className="text-xs text-tech-light/60">DevSecOps</div>
            </div>
          </div>
        </div>

        {/* Footer Note */}
        <div className="mt-8 text-center">
          <p className="text-tech-light/50 text-sm">
            Continuously learning and adapting to new technologies
          </p>
        </div>
      </div>
    </section>
  );
};

export default Skills;
